    private static int findNthDigit(int n) {
        int digits = 1;
        long count = 9;
        int pow = 1;

        while (n > digits * count) {
            n = (int) (n - (digits * count));
            digits++;
            count = count * 10;
            pow = pow * 10;
        }

        pow = pow + (n - 1) / digits;

        String s = Integer.toString(pow);
        char a = s.charAt((n - 1) % digits);

        return a - '0';
    }

